(15569, 'weapon_gemtail_rapier_i00.png', 'Gemtail Rapier', NULL, 'Kamael-exclusive Weapon: Periel Sword Conversion<br/>Can bestow 1 regular Soul Crystal and 1 Special Soul Crystal.<br/>When enchanted to 4 or more, there is a chance that party members including yourself will get increased P. Atk., M. Atk. and the amount of received heal, and decreased MP consumption per skill during a Critical Attack.', 'Драгоценная Рапира', NULL, 'Эксклюзивное оружие Камаэль: Конверсия Меча Очарования</br>Можно применить 1 обыкновенный Кристалл души, 1 Особый Кристалл Души.</br>При модификации на +4 и выше при Крит. Атк. дает шанс увеличить Физ. Атк., Маг. Атк., мощность лечения; уменьшает расход MP для умений Вам и членам Вашей группы.', 1, 1, 1, 's80', 'consume_type_normal'),
(15570, 'weapon_findragon blade_i00.png', 'Finale Blade', NULL, 'Kamael-exclusive Weapon: Feather Eye Blade conversion<br/>Can bestow 1 regular Soul Crystal and 1 Special Soul Crystal.', 'Клинок Плавника', NULL, 'Эксклюзивное оружие Камаэль: Конверсия Клинка Пера</br>Можно применить 1 обыкновенный Кристалл души, 1 Особый Кристалл Души.', 1, 1, 1, 's80', 'consume_type_normal'),
